import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Form, FormControl, Button, NavDropdown, Container } from "react-bootstrap";

function App() {
  return (

    <Navbar className='navbar-expand-lg navbar-success bg-success'>
      <Container className="fluid">
      <a className="navbar-brand" href="#">Logo</a>
      <Button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation"></Button>
      </Container>
    </Navbar>

  );
}

export default App;
